import React, { Component } from 'react';
import './App.css';

class App extends Component {
  constructor(){
    super();

    this.state = {
      // string: "NEGATIVE THOUGHT ELIMINATOR",
      monsters: [
        {
          name: 'Frankenstein'
        },
        {
          name: 'Dracula'
        },
        {
          name: 'Zombie'
        }
      ]
    }

  }
  render() {
      return (
        <div className="App">
          <header className="App-header">
            <p>{this.state.string}</p>
            <button onClick={() => this.setState({ string: 'REMOVED' })}>DELETE</button>
          </header>
           {
             this.state.monsters.map(monster => <h2> {monster.name} </h2>)
           }
        </div>
      );
    }
}

export default App;
